INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES ("ペコリーヌとの出会い", 1, 2, "フリーマーケット会場", 40, 91002, 10118, "青空の下で謁見", 0, 5118061, 0, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 7, 2834, 8);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES ("マホとの出会い", 1, 2, "フリーマーケット会場", 40, 91002, 10118, "未来の騎空団\nマスコット？", 0, 5118062, 0, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 7, 2835, 8);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES ("アキノとの出会い", 1, 2, "ランドソル市街地", 40, 91002, 10118, "お嬢さまからの\n緊急依頼", 0, 5118063, 0, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 7, 2837, 8);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES ("ジュンとの出会い", 1, 2, "フリーマーケット会場", 40, 91002, 10118, "黄金色の悩みごと", 0, 5118064, 0, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 18, 4108402, 8);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES ("カオリとの出会い", 1, 2, "フリーマーケット会場", 40, 91002, 10118, "白熱！　格闘大会！", 0, 5118065, 0, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 18, 4107402, 8);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES ("ニノンとの出会い", 1, 2, "オーエド町", 40, 91002, 10118, "祭り太鼓はオーエドの華", 1, 5118066, 0, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 16, 9000227, 8);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES ("スズナとの出会い", 1, 3, "フリーマーケット会場", 40, 91002, 10118, "人気者は遅れて\nやってくる", 0, 5118067, 0, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 19, 2101181, 8);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES ("ナナカとの出会い", 1, 3, "ランドソル市街地", 40, 91002, 10118, "巫女・ミーツ・魔法少女", 0, 5118068, 0, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 18, 4109402, 8);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES ("キャル＆コッコロとの出会い", 1, 3, "フリーマーケット会場", 40, 91002, 10118, "ネズ耳は二度なくなる", 0, 5118069, 0, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 18, 4305402, 8);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES ("ユカリとの出会い", 1, 3, "ランドソル市街地", 40, 91002, 10118, "この出会いにカンパイ！", 0, 5118070, 0, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 18, 4101402, 8);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES ("アオイとの出会い", 1, 3, "ランドソル市街地", 40, 91002, 10118, "陰陽アンサンブル", 0, 5118071, 0, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 18, 4106402, 8);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES ("シノブとの出会い", 1, 3, "フリーマーケット会場", 40, 91002, 10118, "運試し十番勝負！", 1, 5118072, 0, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 7, 2836, 8);
INSERT INTO `v1_70516c653dd54e04524ab4278c2100fbe019a26e6919e4ec3c55557616056e62` VALUES ("オープニング", 0, 1, 0, 0, 0, 10118, "彼女たちの新たな日常", 0, 5118600, 10145115, 0, 0, 0, 0);
